import React from "react";
import "./App.css";
import "./Components/NavBar/NavBar";
import "./Components/HomePage/HomePage";
import { Switch, Route, withRouter } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h3 className="WCS">Wild Circus</h3>
      <NavBar />
      <section className="route-section">
        <Switch location={location} key={location}>
          <Route exact path="/" component={HomePage} />
          <Route path="/presentation" component={Presentation} />
          <Route exact path="/paris" component={Sport} />
          <Route path="/connexion" component={Connexion} />
          <Route path="/tipsters" component={UsersList} />
          <Route path="/tipster/:idUser" component={User} />
          <Route path="/moncompte" component={UserPage} />
          <Route path="/mesparis" component={UserBets} />
          <Route path="/tipstersuivis" component={UserFollow} />
          <Route path="/faq" component={Faq} />
        </Switch>
      </section>
    </div>
  );
}

export default withRouter(App);
